import React, {useState} from 'react';
import {Navbar} from "../../components/forHome/navbar";
import EventsTable from "../../components/forAdmin/eventsTable";
import {addEventForm} from "../../components//forAdmin/addEventForm";
import AddIcon from "@mui/icons-material/Add";
import {Fab} from "@mui/material";
import {Modal} from "react-bootstrap";
function Dashboard({user, isAuthenticated}) {

    const [isOpen, setIsOpen] = useState(false);
    const openModal = () => setIsOpen(true);
    const closeModal = () => setIsOpen(false);

    //setTimeout(protect, 120);

    /*function protect()
    {
        if (!isAuthenticated && user == null)
            return (<Navigate to={"/"}/>)
    }*/

    return (
        <div>
            <header>
                <Navbar />
                <div
                    id="intro"
                    className="bg-image"
                    style={{
                        background: "#9198e5",
                        "height": "100vh"
                    }}
                >
                    <div className="mask text-white mt-4">
                        <div className="container">
                            <div className="mt-5">
                                <h2 className="text-center m-1">TravnikGO Events</h2>
                                <Fab
                                    style={{ position: "fixed", right: "30px", bottom: "30px" }}
                                    aria-label="Add"
                                    onClick={openModal}
                                    className="add-fab"
                                >
                                    <AddIcon />
                                </Fab>
                                <Modal show={isOpen} onHide={closeModal}>
                                    <Modal.Header closeButton></Modal.Header>
                                    <Modal.Body>
                                        <addEventForm
                                            action="ADD"
                                            closeModal={closeModal}
                                        />
                                    </Modal.Body>
                                </Modal>
                                <EventsTable/>
                            </div>
                        </div>
                    </div>
                </div>
            </header>
        </div>
    );
}

//const mapStateToProps = state => ({isAuthenticated: state.auth.isAuthenticated, user : state.auth.user});


//export default connect(mapStateToProps,null)(Dashboard);
export default Dashboard;
